/* predefined easing functions */
Sliderman.easing({
  name: 'none', 
  method: function(x){
    return x;
  }
});
Sliderman.easing({
  name: 'swing', 
  method: function(x){
    return -Math.cos(x*Math.PI)/2 + 0.5;
  }
});
Sliderman.easing({
  name: 'wave', 
  method: function(t){
    return ((Math.cos((1-t)*3*Math.PI+2*Math.PI))*0.5+0.5+t)/2;
  }
});
Sliderman.easing({
  name: 'bounce', 
  method: function(t){
    return 1 - Math.abs(Math.cos((1-t)*(2.5+t*t*3)*Math.PI+0.5*Math.PI)*(1-t));
  }
});
