Sliderman.order({
  name: 'straight_stairs', 
  method: function(e){
    var cols = e.cols, rows = e.rows, road = e.road, count = e.count;
    var a = [], i = 0, c = 0, r = 0, cl = cols - 1, rl = rows - 1, il = count - 1, cr;
    switch(road){
      case 'BL': case 'TR': case 'TL': case 'BR':
        var C = 0, R = 0;
        break;
      case 'LB': case 'RT': case 'LT': case 'RB': default:
        road = 'RB';
        var C = cl, R = 0;
        break;
    }
    c = C;
    r = R;
    while(i < count){
      cr = r+','+c;
      if(road.indexOf('T') == 1 || road.indexOf('R') == 1) a[cr] = il - i++;
      else a[cr] = i++;
      switch(road){
        case 'BL': case 'TR':
          c--;
          r++;
          break;
        case 'TL': case 'BR':
          c++;
          r--;
          break;
        case 'LB': case 'RT':
          c--;
          r--;
          break;
        case 'RB': case 'LT': default:
          c++;
          r++;
          break;
      }
      if(c < 0 || r < 0 || c > cl || r > rl){
        switch(road){
          case 'BL': case 'TR':
            C++;
            break;
          case 'LB': case 'RT': case 'TL': case 'BR':
            R++;
            break;
          case 'RB': case 'LT': default:
            C--;
            break;
        }
        if(C < 0 || R < 0 || C > cl || R > rl){
          switch(road){
            case 'BL': case 'TR':
              C = cl;
              R++;
              break;
            case 'TL': case 'BR':
              R = rl;
              C++;
              break;
            case 'LB': case 'RT':
              R = rl;
              C--;
              break;
            case 'RB': case 'LT': default:
              C = 0;
              R++;
              break;
          }
          if(R > rl) R = rl;
          else if(R < 0) R = 0;
          else if(C > cl) C = cl;
          else if(C < 0) C = 0;
        }
        r = R;
        c = C;
      }
    }
    return a;
  }
});
Sliderman.order({
  name: 'square', 
  method: function(effect){
    var cols = effect.cols || 1, rows = effect.rows || 1, arr = [], i = 0, c, r, dc, dr, cr;
    dc = cols < rows ? (rows-cols)/2 : 0;
    dr = cols > rows ? (cols-rows)/2 : 0;
    cr = Math.round(Math.max(cols/2, rows/2)) + 1;
    for(c = 0; c < cols; c++) for(r = 0; r < rows; r++) arr[r+','+c] = cr - Math.min(c+1+dc, r+1+dr, cols-c+dc, rows-r+dr);
    return arr;
  }
});
